import printstamp from '../../contract/abiclasses/printstamp'
import Button from 'react-bootstrap/Button';
import { Outlet, Link } from "react-router-dom";

class MyPrinters extends Component {

constructor(props) {
  super(props)

  this.state = {
    printerAddress: '',
    printerName:'',
     contract: null,
  }
  this.contract = new printstamp()
}

test = async () => {
  for(var i =0; i<5;i++){
